INSERT INTO `announcement` VALUES (2,'published',NULL,'973782b7-e96e-415b-b382-e7820a2fa7ff','2022-02-14 09:42:59','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:04:52','Instructions for Students Regarding MCQ based Online Examination',2,'2022-01-12','<ol>\n<li>Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.</li>\n<li>The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br /><strong>Slot-I - 10.00 am-12.00 noon and</strong><br /><strong>Slot-II - 2.00 pm to 4.00 pm</strong><br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.</li>\n<li>Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.</li>\n<li>All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.</li>\n<li>Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</li>\n</ol>'),(3,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 10:47:33','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:07:59','Holi',3,'2022-02-07','<p>All the students are hereby informed that on the<br />occasion of Holi festival, the classes will remain<br />closed from <em>20th March</em> to<em> 22nd March, 2019</em>.<br />The classes will resume from <em>23rd March,2019</em><br />as per the schedule</p>\n<p>&nbsp;</p>\n<p>.<img src=\"https://cms.vp.appsinfra.in/assets/dfa5719b-0283-4c5c-92f9-8f00edbf5af9?width=510&amp;height=340\" alt=\"1616837581 Theme.jpg\" /></p>'),(4,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 11:46:11',NULL,NULL,'Exam Day and Date wise Final Time Table for MCQ based on-line Winter 2021 theory Exam',2,'2021-12-13','<p><a title=\"\" href=\"https://online.msbte.co.in/msbte21/reportsindex.php?act=time_table_w&amp;sub=print_tt\" target=\"_blank\" rel=\"noopener\">Click Here</a> to View the Time Table,</p>\n<p>Best of Luck</p>'),(5,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 11:50:25','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 11:55:19','Summer 2022 Examination Postponed',2,'2022-02-18','<p><img src=\"https://cms.vp.appsinfra.in/assets/2f2a0de1-b919-44aa-aeaa-f4c5b99a753e?width=1024&amp;height=683\" alt=\"Postpone Notice\" /></p>'),(6,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 12:00:50','443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-23 06:33:26','Filling Chief Coordinator/ Coordinator details in Online Examination Module for Online Summer 2020 Examination',2,'2022-02-25','<p><img src=\"https://cms.vp.appsinfra.in/assets/3c00e679-6963-4eab-aceb-1b8653c650b4?width=1240&amp;height=1754\" alt=\"Online Examination Module Circular 160920201819\" /></p>'),(7,'draft',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 12:12:16','973782b7-e96e-415b-b382-e7820a2fa7ff','2022-02-20 07:48:42','MCQ based Online Examination MSBTE Time Table for Winter 2021 Examination',2,'2022-02-18','<p><a title=\"\" href=\"https://cms.vp.appsinfra.in/assets/970a8d7f-b76f-4c8e-b860-4878170e1eee\" target=\"_blank\" rel=\"noopener\">Click Here</a> to View Time Table</p>'),(8,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 12:18:07','973782b7-e96e-415b-b382-e7820a2fa7ff','2022-02-25 10:57:09','DURGA PUJA',3,'2021-09-24','<p>It is notified to all students and teachers that the institute will remain closed on the ocassion of DURGA&nbsp; PUJA from <em>11/10/2021</em> to <em>16/10/2021</em>. The school will re-open on <em>18/10/2021(<strong>Monday</strong>)</em>.</p>\n<p>&nbsp;</p>\n<p><img src=\"https://cms.vp.appsinfra.in/assets/12eaaf82-0760-4947-8776-4338078c8324?width=1024&amp;height=697\" alt=\"Durga Puja Design Vector Id1271474766\" /></p>'),(9,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 12:23:52','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:07:04','Diwali',3,'2021-10-24','<p>Diwali or Deepavali, the festival of lights is the five-day festival of lights, celebrated by millions of Hindus, Sikhs and Jains across the world. The festival, which coincides with the Hindu New Year, celebrates new beginnings and the triumph of good over evil and light over darkness.</p>\n<p>From <em>2nd November </em>to<em> 6th November</em> will celebrate Diwali Festival all over India</p>\n<p>Our institute will resume on November 7th.</p>\n<p>Wish you all a very Happy Diwali.</p>\n<p>&nbsp;</p>\n<p><img src=\"https://cms.vp.appsinfra.in/assets/58c119e8-10ae-49ea-a42d-66adcfe41f6c?width=1024&amp;height=538\" alt=\"Diwali.jpg\" /></p>'),(10,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-19 12:28:49','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:06:29','Summer Vacation',3,'2021-03-29','<p>This is to inform to the students of Vidyalankar Polytechnic that the <em>summer vacations</em> are going to begin from <strong>1st April</strong> and will end on <strong>30th April</strong>. Students who have joined clubs and academy for any sports will anyhow be allowed to enter the premises at the time of coaching.</p>'),(11,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:11:13','443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:13:13','FY-22 Admissions are open now',6,'2022-02-19','<p>We are glad to announce that first year admission for diploma in engineering are open now.&nbsp;</p>\n<p>For further information please contact us @ +91 9967033322 or visit our <a title=\"\" href=\"https://vpt.edu.in/diploma/polytechnic/admissions.html\" target=\"_blank\" rel=\"noopener\">website</a>.</p>\n<p>&nbsp;</p>'),(12,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:17:48',NULL,NULL,'Rules for direct 2nd year admissions',6,'2022-02-24','<p><img src=\"https://cms.vp.appsinfra.in/assets/16fc05d2-151e-48bd-b1af-14b927308ab8?width=707&amp;height=583\" alt=\"Rules for d2y\" /></p>'),(13,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:30:49',NULL,NULL,'Even Term academic schedule 2021-22',5,'2022-02-09','<p>Please refer the document for even term academic schedule for year 2021-22.</p>\n<p>Link : <a title=\"\" href=\"https://vpt.edu.in/diploma/polytechnic/images/AcademicSchedule.pdf\" target=\"_blank\" rel=\"noopener\">Academic Schedule</a></p>'),(14,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:34:59',NULL,NULL,'Fees payment reminder',5,'2022-02-19','<p>Students are requested to pay their tution fees for year 2021-22 till 10-Mar-2022.</p>\n<p>Fees can be paid on our <a title=\"\" href=\"www.vpt.edu.in\" target=\"_blank\" rel=\"noopener\">website </a>or drop a dd at our office</p>\n<p>Office Timings: 10AM to 3PM</p>'),(16,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 14:55:00','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:09:55','Project Submissions',5,'2022-02-24','<p>All Final Year students are requested to submit their projects till <em>12-Mar-2022</em>.</p>\n<p>Contact your respective guides for any queries.</p>'),(17,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 15:00:54','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-02-22 11:10:47','Admission documents',6,'2022-02-21','<p>Students are requested to sumbit the following documents on the day of admission.</p>\n<hr />\n<p><em><strong>1.Aadhar card</strong></em></p>\n<p><em><strong>2.10th/12th Marksheet</strong></em></p>\n<p><em><strong>3.Leaving Certificate</strong></em></p>\n<p><em><strong>4.Z proforma or 8th and 9th Marksheets</strong></em></p>\n<p><em><strong>5.Caste certificate (if applied)&nbsp;</strong></em></p>'),(18,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-02-19 15:04:41',NULL,NULL,'Direct SY admissions',6,'2022-03-07','<p>Direct Second Year admissions are open now.</p>\n<p>Please visit our <a title=\"\" href=\"www.vpt.edu.in\" target=\"_blank\" rel=\"noopener\">website&nbsp; </a>or our office for admission details</p>\n<p>Contact us @ 99657033322&nbsp;</p>');
