inter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.<br />2. The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br />Slot-I - 10.00 am-12.00 noon and<br />Slot-II - 2.00 pm to 4.00 pm<br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.<br />3. Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.<br />4. All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.<br />5. Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</p>\", \"date_created\": \"2022-02-14T09:42:59.000Z\", \"date_updated\": \"2022-02-19T11:23:47.000Z\", \"user_created\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-01-31\", \"more_information\": null}','{\"title\": \"Winter 21 MSBTE Examinations\", \"description\": \"<p>1. Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.<br />2. The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br />Slot-I - 10.00 am-12.00 noon and<br />Slot-II - 2.00 pm to 4.00 pm<br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.<br />3. Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.<br />4. All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.<br />5. Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</p>\", \"date_updated\": \"2022-02-19T11:23:46.936Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(436,485,'announcement','2','{\"id\": 2, \"sort\": null, \"title\": \"Winter 21 MSBTE Examinations\", \"status\": \"published\", \"category\": 2, \"description\": \"<p>1. Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.<br />2. The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br />Slot-I - 10.00 am-12.00 noon and<br />Slot-II - 2.00 pm to 4.00 pm<br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.<br />3. Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.<br />4. All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.<br />5. Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</p>\", \"date_created\": \"2022-02-14T09:42:59.000Z\", \"date_updated\": \"2022-02-19T11:24:04.000Z\", \"user_created\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\", \"user_updated\": \