t=\\\"Online Examination Module Circular 160920201819\\\" /></p>\", \"date_created\": \"2022-02-19T12:00:50.000Z\", \"date_updated\": \"2022-02-19T12:06:38.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-02-25\"}','{\"description\": \"<p><img src=\\\"https://cms.vp.appsinfra.in/assets/3c00e679-6963-4eab-aceb-1b8653c650b4?width=1240&amp;height=1754\\\" alt=\\\"Online Examination Module Circular 160920201819\\\" /></p>\", \"date_updated\": \"2022-02-19T12:06:37.870Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(474,526,'announcement','2','{\"id\": 2, \"sort\": null, \"title\": \"Instructions for Students Regarding MCQ based Online Examination\", \"status\": \"published\", \"category\": 2, \"description\": \"<ol>\\n<li>Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.</li>\\n<li>The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br />Slot-I - 10.00 am-12.00 noon and<br />Slot-II - 2.00 pm to 4.00 pm<br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.</li>\\n<li>Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.</li>\\n<li>All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.</li>\\n<li>Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</li>\\n</ol>\", \"date_created\": \"2022-02-14T09:42:59.000Z\", \"date_updated\": \"2022-02-19T12:08:58.000Z\", \"user_created\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-01-12\"}','{\"title\": \"Instructions for Students Regarding MCQ based Online Examination\", \"date_updated\": \"2022-02-19T12:08:58.182Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(475,528,'directus_files','970a8d7f-b76f-4c8e-b860-4878170e1eee','{\"type\": \"application/pdf\", \"title\": \"Mcq Based Online Examination Msbte Time Table for Winter 2021 Examination\", \"folder\": null, \"storage\": \"local\", \"filename_download\": \"MCQ based Online Examination MSBTE Time Table for Winter 2021 Examination.pdf\"}','{\"type\": \"application/pdf\", \"title\": \"Mcq Based Online Examination Msbte Time Table for Winter 2021 Examination\", \"folder\": null, \"storage\": \"local\", \"filename_download\": \"MCQ based Online Examination MSBTE Time Table for Winter 2021 Examination.pdf\"}',NULL),(476,529,'announcement','7','{\"title\": \"MCQ based Online Examination MSBTE Time Table for Winter 2021 Examination\", \"category\": 2, \"description\": \"<p><a title=\\\"\\\" href=\\\"https://cms.vp.appsinfra.in/admin/files/970a8d7f-b76f-4c8e-b860-4878170e1eee\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Click Here</a> to View Time Table</p>\", \"date_published\": \"2022-02-19\"}','{\"title\": \"MCQ based Online Examination MSBTE Time Table for Winter 2021 Examination\", \"category\": 2, \"description\": \"<p><a title=\\\"\\\" href=\\\"https://cms.vp.appsinfra.in/admin/files/970a8d7f-b76f-4c8e-b860-4878170e1eee\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">Click Here</a> to View Time Table</p>\", \"date_published\": \"2022-02-19\"}',NULL),(477,530,'directus_files','12eaaf82-0760-4947-8776-4338078c8324','{\"type\": \"image/jpeg\", \"title\": \"Durga Puja Design Vector Id1271474766\", \"folder\": \"c55e4747-7dfb-4f1b-ad96-2e6e52ca43b2\", \"storage\": \"lo