itle}}\"}, \"special\": \"m2o\", \"required\": true, \"interface\": \"select-dropdown-m2o\", \"collection\": \"section\"}',NULL),(601,701,'directus_fields','173','{\"field\": \"sections\", \"options\": {\"template\": \"{{title}}\"}, \"special\": \"o2m\", \"required\": true, \"interface\": \"list-o2m\", \"collection\": \"Page\"}','{\"field\": \"sections\", \"options\": {\"template\": \"{{title}}\"}, \"special\": \"o2m\", \"required\": true, \"interface\": \"list-o2m\", \"collection\": \"Page\"}',NULL),(605,708,'announcement','2','{\"id\": 2, \"sort\": null, \"title\": \"Instructions for Students Regarding MCQ based Online Examination\", \"status\": \"published\", \"category\": 2, \"description\": \"<ol>\\n<li>Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.</li>\\n<li>The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br /><strong>Slot-I - 10.00 am-12.00 noon and</strong><br /><strong>Slot-II - 2.00 pm to 4.00 pm</strong><br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.</li>\\n<li>Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.</li>\\n<li>All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.</li>\\n<li>Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</li>\\n</ol>\", \"date_created\": \"2022-02-14T09:42:59.000Z\", \"date_updated\": \"2022-02-22T11:04:52.000Z\", \"user_created\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-01-12\"}','{\"description\": \"<ol>\\n<li>Exam day and Date wise Final Time Table for MCQ based on-line Winter 2021 Theory Examination is<br />displayed on MSBTE portal for the information of students, institutes and all concerned.</li>\\n<li>The Examination shall be conducted in 2 slots of 2 hours each as displayed in above Timetable<br /><strong>Slot-I - 10.00 am-12.00 noon and</strong><br /><strong>Slot-II - 2.00 pm to 4.00 pm</strong><br />Students shall login and start the on-line theory examination within the slot timing. The time<br />allotted for examination is one hour (60minutes) only from the instant of start of examination.</li>\\n<li>Link for Examination will be available in the eligible candidate&rsquo;s login strictly as per the time slot<br />specified in the Time table above.</li>\\n<li>All students belonging to old schemes shall note that the theory examination shall be as per the<br />paper codes which are offered as equivalent to the courses in old schemes and indicated on the hall<br />ticket.</li>\\n<li>Examination of different semesters scheduled on the same day but in different slots shall not be<br />considered as clash.</li>\\n</ol>\", \"date_updated\": \"2022-02-22T11:04:51.572Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(606,709,'announcement','10','{\"id\": 10, \"sort\": null, \"title\": \"Summer Vacation\", \"status\": \"published\", \"category\": 3, \"description\": \"<p>This is to inform to the students of Vidyalankar Polytechnic that the <em>summer vacations</em> are going to begin from <strong>1st April</strong> and will end on <strong>30th April</strong>. Students who have joined clubs and academy for any sports will anyhow be allowed to enter the premises at the time of coaching.</p>\", \"date_created\": \"2022-02-19T12:28:49.000Z\", \"date_updated\": \"2022-02-22T11:06:29.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2021-03-29\"}','{\"description\": \"<p>This is to inform to the students of Vidyalankar Polytechnic that the <em>summer vacations</em> are going to begin from <strong>1st April</strong> and will end on <strong>30th April</strong>. Students who have joined clubs and academy for any sports will anyhow be allowed to enter the premises at the time of coaching.</p>\", \"date_updated\": \"2022-02-22T11:06:28.905Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(607,710,'announcement','9','{\"id\": 9, \"sort\": null, \"title\": \"Diwali\", \"status\": \"published\", \"category\": 3, \"description\": \"<p>Diwali or Deepavali, the festival of lights is the five-day festival of lights, celebrated by millions of Hindus, Sikhs and Jains across the world. The festival, which coincides with the Hindu New Year, celebrates new beginnings and the triumph of good over evil and light over darkness.</p>\\n<p>From <em>2nd November </em>to<em> 6th November</em> will celebrate Diwali Festival all over India</p>\\n<p>Our institute will resume on November 7th.</p>\\n<p>Wish you all a very Happy Diwali.</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"https://cms.vp.appsinfra.in/assets/58c119e8-10ae-49ea-a42d-66adcfe41f6c?width=1024&amp;height=538\\\" alt=\\\"Diwali.jpg\\\" /></p>\", \"date_created\": \"2022-02-19T12:23:52.000Z\", \"date_updated\": \"2022-02-22T11:07:04.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2021-10-24\"}','{\"description\": \"<p>Diwali or Deepavali, the festival of lights is the five-day festival of lights, celebrated by millions of Hindus, Sikhs and Jains across the world. The festival, which coincides with the Hindu New Year, celebrates new beginnings and the triumph of good over evil and light over darkness.</p>\\n<p>From <em>2nd November </em>to<em> 6th November</em> will celebrate Diwali Festival all over India</p>\\n<p>Our institute will resume on November 7th.</p>\\n<p>Wish you all a very Happy Diwali.</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"https://cms.vp.appsinfra.in/assets/58c119e8-10ae-49ea-a42d-66adcfe41f6c?width=1024&amp;height=538\\\" alt=\\\"Diwali.jpg\\\" /></p>\", \"date_updated\": \"2022-02-22T11:07:03.892Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(608,711,'announcement','8','{\"id\": 8, \"sort\": null, \"title\": \"DURGA PUJA\", \"status\": \"published\", \"category\": 3, \"description\": \"<p>It is notified to all students and teachers that the institute will remain closed on the ocassion of DURGA&nbsp; PUJA from <em>11/10/2021</em> to <em>16/10/2021</em>. The school will re-open on <em>18/10/2021(Monday)</em>.</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"https://cms.vp.appsinfra.in/assets/12eaaf82-0760-4947-8776-4338078c8324?width=1024&amp;height=697\\\" alt=\\\"Durga Puja Design Vector Id1271474766\\\" /></p>\", \"date_created\": \"2022-02-19T12:18:07.000Z\", \"date_updated\": \"2022-02-22T11:07:33.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2021-09-24\"}','{\"description\": \"<p>It is notified to all students and teachers that the institute will remain closed on the ocassion of DURGA&nbsp; PUJA from <em>11/10/2021</em> to <em>16/10/2021</em>. The school will re-open on <em>18/10/2021(Monday)</em>.</p>\\n<p>&nbsp;</p>\\n<p><img src=\\\"https://cms.vp.appsinfra.in/assets/12eaaf82-0760-4947-8776-4338078c8324?width=1024&amp;height=697\\\" alt=\\\"Durga Puja Design Vector Id1271474766\\\" /></p>\", \"date_updated\": \"2022-02-22T11:07:32.513Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(609,712,'announcement','3','{\"id\": 3, \"sort\": null, \"title\": \"Holi\", \"status\": \"published\", \"category\": 3, \"description\": \"<p>All the