611,714,'announcement','16','{\"id\": 16, \"sort\": null, \"title\": \"Project Submissions\", \"status\": \"published\", \"category\": 5, \"description\": \"<p>All Final Year students are requested to submit their projects till <em>12-Mar-2022</em>.</p>\\n<p>Contact your respective guides for any queries.</p>\", \"date_created\": \"2022-02-19T14:55:00.000Z\", \"date_updated\": \"2022-02-22T11:09:55.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-02-24\"}','{\"description\": \"<p>All Final Year students are requested to submit their projects till <em>12-Mar-2022</em>.</p>\\n<p>Contact your respective guides for any queries.</p>\", \"date_updated\": \"2022-02-22T11:09:55.196Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(612,715,'announcement','17','{\"id\": 17, \"sort\": null, \"title\": \"Admission documents\", \"status\": \"published\", \"category\": 6, \"description\": \"<p>Students are requested to sumbit the following documents on the day of admission.</p>\\n<hr />\\n<p><em><strong>1.Aadhar card</strong></em></p>\\n<p><em><strong>2.10th/12th Marksheet</strong></em></p>\\n<p><em><strong>3.Leaving Certificate</strong></em></p>\\n<p><em><strong>4.Z proforma or 8th and 9th Marksheets</strong></em></p>\\n<p><em><strong>5.Caste certificate (if applied)&nbsp;</strong></em></p>\", \"date_created\": \"2022-02-19T15:00:54.000Z\", \"date_updated\": \"2022-02-22T11:10:47.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-02-21\"}','{\"description\": \"<p>Students are requested to sumbit the following documents on the day of admission.</p>\\n<hr />\\n<p><em><strong>1.Aadhar card</strong></em></p>\\n<p><em><strong>2.10th/12th Marksheet</strong></em></p>\\n<p><em><strong>3.Leaving Certificate</strong></em></p>\\n<p><em><strong>4.Z proforma or 8t