gement: Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p>&nbsp;</p>\\n<p>Life-long learning Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\", \"date_created\": \"2022-02-26T14:39:50.000Z\", \"date_updated\": \"2022-02-26T15:23:47.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}','{\"date_updated\": \"2022-02-26T15:23:46.506Z\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}',NULL),(986,1114,'directus_collections','department_course','{\"icon\": \"import_export\", \"note\": null, \"sort\": 5, \"color\": null, \"group\": \"department\", \"hidden\": false, \"collapse\": \"open\", \"singleton\": false, \"collection\": \"department_course\", \"sort_field\": null, \"translations\": null, \"archive_field\": null, \"archive_value\": null, \"accountability\": \"all\", \"unarchive_value\": null, \"display_template\": null, \"archive_app_filter\": true, \"item_duplication_fields\": null}','{\"hidden\": false}',NULL),(987,1115,'course','2','{\"id\": 2, \"abbr\": \"Eng\", \"code\": \"22101\", \"name\": \"English\", \"sort\": null, \"status\": \"published\", \"syllabus\": \"6aba8bce-ca2d-41bd-8b79-c1a6d368d65b\", \"date_created\": \"2022-02-26T14:39:50.000Z\", \"date_updated\": \"2022-02-26T15:25:06.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}','{\"name\": \"English\", \"date_updated\": \"2022-02-26T15:25:06.048Z\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}',988),(988,1116,'department_course','1','{\"id\": 1, \"course_id\": 2, \"semester_id\": 1, \"department_id\": 1}','{\"course_id\": 2, \"semester_id\": 1, \"department_id\": \"1\"}',989),(989,1117,'department','1','{\"id\": 1, \"name\": \"Computer Engine