ustain the challenges in the field of Electronics and Telecommunication.</p>\\n<p class=\\\"text-justify\\\">M2:Educating the students to face the competitive world, develop leadership skills and to instil discipline and ethics.</p>\\n<p class=\\\"text-justify\\\">M3:Promoting industry institute interaction.</p>\", \"outcomes\": \"<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Basic and Discipline specific knowledge:&nbsp;</strong>Apply knowledge of basic mathematics, science and engineering fundamentals and engineering specialization to solve the engineering problems.</p>\\n<p class=\\\"text-justify\\\"><strong>Problem analysis:&nbsp;</strong>Identify and analyse well-defined engineering problems using codified standard methods.</p>\\n<p class=\\\"text-justify\\\"><strong>Design/ development of solutions:&nbsp;</strong>Design solutions for well-defined technical problems and assist with the design of systems components or processes to meet specified needs.</p>\\n<p class=\\\"text-justify\\\"><strong>Engineering Tools, Experimentation and Testing:&nbsp;</strong>Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n</div>\\n<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Engineering practices for society, sustainability and environment:&nbsp;</strong>Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p class=\\\"text-justify\\\"><strong>Project Management:&nbsp;</strong>Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p class=\\\"text-justify\\\"><strong>Life-long learning:&nbsp;</strong>Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\\n</div>\", \"date_created\": \"2022-02-28T14:10:38.000Z\", \"date_updated\": \"