133,1304,'info_page_section','2','{\"title\": \"Test\", \"status\": \"published\", \"info_page\": 2}','{\"title\": \"Test\", \"status\": \"published\", \"info_page\": 2}',1134),(1134,1305,'info_page','2','{\"icon\": \"938e3cc9-a584-4ddb-a7c7-2eb1c045d184\", \"name\": \"Admission\", \"status\": \"published\", \"sections\": [{\"title\": \"Test\", \"status\": \"published\"}]}','{\"icon\": \"938e3cc9-a584-4ddb-a7c7-2eb1c045d184\", \"name\": \"Admission\", \"status\": \"published\", \"sections\": [{\"title\": \"Test\", \"status\": \"published\"}]}',NULL),(1135,1307,'directus_files','441e86f1-2e5f-4523-8ded-6bcbfa69dcd2','{\"type\": \"image/png\", \"title\": \"Admission Icons8 Admission 80\", \"folder\": \"86e1eea6-09c6-404c-9f7f-4618833367c9\", \"storage\": \"local\", \"filename_download\": \"admission icons8-admission-80.png\"}','{\"type\": \"image/png\", \"title\": \"Admission Icons8 Admission 80\", \"folder\": \"86e1eea6-09c6-404c-9f7f-4618833367c9\", \"storage\": \"local\", \"filename_download\": \"admission icons8-admission-80.png\"}',NULL),(1136,1308,'info_page_section','3','{\"title\": \"Why Diploma\", \"status\": \"published\", \"info_page\": 3, \"description\": \"<p>Why Diploma after 10th for Engineering aspirants?</p>\\n<p>&nbsp;</p>\\n<ol>\\n<li>Diploma pass students get direct second year admission, so number of years required to pass engineering remains same (2+4 and 3+3)</li>\\n<li>NO entrance examination like JEE / CET for diploma students while getting degree admission</li>\\n<li>Diploma curriculum offers more hands on practices so Industry prefer Diploma + Degree graduates while recruitment</li>\\n<li>Diploma is only career path that provide job as well as entrepreneurship opportunity</li>\\n<li>Diploma graduated can also opt for foreign university graduation courses</li>\\n</ol>\"}','{\"title\": \"Why Diploma\", \"status\": \"published\", \"info_page\": 3, \"description\": \"<p>Why Diploma after 10th for Engineering aspirants?</p>\\n<p>&nbsp;</p>\\n<ol>