2c!2sVidyalankar%20Polytechnic!5e0!3m2!1sen!2sin!4v1587674082566!5m2!1sen!2sin\\\" width=\\\"100%\\\" height=\\\"450\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" aria-hidden=\\\"false\\\"></iframe></p>\", \"date_updated\": \"2022-03-11T05:01:07.685Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',1365),(1365,1560,'info_page','4','{\"id\": 4, \"icon\": \"6618b1a9-7394-4939-8120-2beedc59b056\", \"name\": \"Locate Us\", \"sort\": null, \"status\": \"published\", \"sections\": [5, 6], \"date_created\": \"2022-03-11T02:58:50.000Z\", \"date_updated\": \"2022-03-11T05:01:08.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"date_updated\": \"2022-03-11T05:01:07.678Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1366,1561,'blog','1','{\"id\": 1, \"sort\": null, \"tags\": [\"Java\", \"Jdk\", \"Programming\", \"Sdk\", \"Technical\"], \"image\": \"0e6c6d65-2bd7-4fc0-9409-180dff82481f\", \"title\": \"Java News Roundup: Spring Projects Updates, Value Objects (Preview) JEP, Quarkus 2.7.2\", \"author\": \"Anurag Dubey\", \"status\": \"published\", \"content\": \"<div class=\\\"article__data\\\">\\n<p>This week\'s Java roundup for February 21st, 2022, features news from OpenJDK, JDK 18, JDK 19, Quarkus 2.7.2.Final, JReleaser early-access, and multiple Spring project updates: Spring Boot 2.7.0-M1, 2.6.4, 2.5.10; a new <strong><code>ListCrudRepository</code></strong> interface for Spring Data 3.0-M2; Spring Security 5.7.0-M2, 5.6.2, 5.5.5; Spring Session 2021.1.2, 2021.0.5; Spring Shell 2.1.0-M3; and Spring Batch 4.3.5.</p>\\n<h3>OpenJDK</h3>\\n<p>JEP Draft 8277163, <a href=\\\"https://openjdk.java.net/jeps/8277163\\\">Value Objects (Preview)</a>, was promoted from <strong>Draft</strong> to <strong>Submitted</strong> status this past week, stating that the JEP owner, <a href=\\\"https://www.linkedin.com/in/dansmithjava\\\">Dan Smith</a>, has declared this draft as ready for evaluation towards <strong>Candidate</strong> status. This JEP proposes the creation of value objects, identity-free value classes that specify the behavior of their instances. This draft is related to JEP 401, <a href=\\\"https://openjdk.java.net/jeps/401\\\">Primitive Classes (Preview)</a>, and will provide continued contribution towards fulfilling <a href=\\\"https://openjdk.java.net/projects/valhalla/\\\">Project Valhalla</a>.</p>\\n<h3>JDK 18</h3>\\n<p><a href=\\\"https://github.com/openjdk/jdk/releases/tag/jdk-18%2B37\\\">Build 37</a> of the JDK 18 <a href=\\\"https://jdk.java.net/18/\\\">early access builds</a> was made available this past week, but there were no comparable <a href=\\\"https://github.com/openjdk/jdk/compare/jdk-18%2B36...jdk-18%2B37\\\">updates</a> from Build 36. With less than a month before the GA release of JDK 18, the updated <a href=\\\"https://jdk.java.net/18/release-notes\\\">release notes</a> include links to documents such as the <a href=\\\"https://cr.openjdk.java.net/~iris/se/18/latestSpec//api/index.html\\\">complete API specification</a> and an <a href=\\\"https://cr.openjdk.java.net/~iris/se/18/latestSpec/apidiffs/overview-summary.html\\\">annotated API specification</a> comparing the differences between JDK 17 (<a href=\\\"https://github.com/openjdk/jdk/releases/tag/jdk-17%2B35\\\">Build 35</a>) and JDK 18 (Build 37).</p>\\n<h3>JDK 19</h3>\\n<p><a href=\\\"https://github.com/openjdk/jdk/releases/tag/jdk-19%2B11\\\">Build 11</a> of the JDK 19 <a href=\\\"https://jdk.java.net/19/\\\">early-access builds</a> was also made available this past week, featuring <a href=\\\"https://github.com/openjdk/jdk/compare/jdk-19%2B10...jdk-19%2B11\\\">updates</a> from Build 10 that include fixes to various <a href=\\\"https://bugs.openjdk.java.net/issues/?jql=project%20%3D%20JDK%20AND%20fixversion%20%3D%2019%20and%20%22resolved%20in%20build%22%20%3D%20b11%20order%20by%20component%2C%20subcomponent\\\">issues</a>. More details may be found in the <a href=\\\"https://jdk.java.net/19/release-notes\\\">release notes</a>.</p>\\n<p>For JDK 18 and <a href=\\\"https://openjdk.java.net/projects/jdk/19/\\\">JDK 19</a>, developers are encouraged to report bugs via the <a href=\\\"https://bugreport.java.com/bugreport/\\\">Java Bug Database</a>.</p>\\n<h3>Spring Framework</h3>\\n<p>It was a very busy week over at Spring as the team provided numerous point and milestone releases for <a href=\\\"https://spring.io/projects/spring-boot\\\">Spring Boot</a>, <a href=\\\"https://spring.io/projects/spring-data\\\">Spring Data</a>, <a href=\\\"https://spring.io/projects/spring-security\\\">Spring Security</a>, <a href=\\\"https://spring.io/projects/spring-session\\\">Spring Session</a>, <a href=\\\"https://spring.io/projects/spring-shell\\\">Spring Shell</a>, and <a href=\\\"https://spring.io/projects/spring-batch\\\">Spring Batch</a>.</p>\\n<p>On the road to Spring Boot 2.7.0, the <a href=\\\"https://spring.io/blog/2022/02/24/spring-boot-2-7-0-m2-available-now\\\">second milestone release</a> was made available to include 137 bug fixes, documentation improvements and dependency upgrades. New <a href=\\\"https://github.com/spring-projects/spring-boot/releases/tag/v2.7.0-M2\\\">features</a> include: test annotations for <a href=\\\"https://github.com/spring-projects/spring-boot/pull/29912\\\">Couchbase</a> and <a href=\\\"https://github.com/spring-projects/spring-boot/pull/29911\\\">Elasticsearch</a>; enhancements to <a href=\\\"https://github.com/spring-projects/spring-boot/issues/29907\\\">auto-configuration registration and ordering</a> with the new <strong><code>@AutoConfiguration</code></strong> annotation; and support for <a href=\\\"https://square.github.io/okhttp/\\\">OkHttp</a> 4.9.3. Further details may be found in the <a href=\\\"https://github.com/spring-projects/spring-boot/wiki/Spring-Boot-2.7.0-M2-Release-Notes\\\">release notes</a>.</p>\\n<p>Spring Boot 2.6.4 has been <a href=\\\"https://spring.io/blog/2022/02/24/spring-boot-2-6-4-available-now\\\">released</a> featuring 61 bug fixes, documentation improvements and dependency upgrades. More details may be found in the <a href=\\\"https://github.com/spring-projects/spring-boot/releases/tag/v2.6.4\\\">changelog</a>.</p>\\n<p>Spring Boot 2.5.10 has been <a href=\\\"https://spring.io/blog/2022/02/24/spring-boot-2-5-10-available-now\\\">released</a> featuring 52 bug fixes, documentation improvements and dependency upgrades. Further details may be found in the <a href=\\\"https://github.com/spring-projects/spring-boot/releases/tag/v2.5.10\\\">changelog</a>.</p>\\n<p>The Spring Data team has <a href=\\\"https://spring.io/blog/2022/02/22/announcing-listcrudrepository-friends-for-spring-data-3-0\\\">introduced</a> a <strong><code>ListCrudRepository</code></strong> interface for Spring Data 3.0-M2 designed to return a result set of type <strong><code>List</code></strong> instead of an <strong><code><a href=\\\"https://docs.oracle.com/javase/8/docs/api/java/lang/Iterable.html\\\">Interable</a></code></strong>, the type returned by the well-known <strong><code><a href=\\\"https://docs.spring.io/spring-data/commons/docs/current/api/org/springframework/data/repository/CrudRepository.html\\\">CrudRepository</a></code></strong> interface. The motivation is to offer developers a choice with a preferred return type when working with Spring Data.</p>\\n<p>On the road to Spring Security 5.7.0, the <a href=\\\"https://spring.io/blog/2022/02/21/spring-security-5-7-0-m2-released\\\">second milestone</a> has been released that will deprecate the <strong><code><a href=\\\"https://docs.spring.io/spring-security/site/docs/current/api/org/springframework/security/config/annotation/web/configuration/WebSecurityConfigurerAdapter.html\\\">WebSecurityConfigurerAdapter</a></code></strong> class as a move towards a component-based security configuration. Developers are encouraged to read this <a href=\\\"https://spring.io/blog/2022/02/21/spring-security-without-the-websecurityconfigureradapter\\\">blog post</a> on using Spring Security without <strong><code>WebSecurityConfigurerAdapter</code></strong> and more details may also be found in the <a href=\\\"https://github.com/spring-projects/spring-security/releases/tag/5.7.0-M2\\\">release notes</a>.</p>\\n<p>Spring Security 5.6.2 and 5.5.5 have been <a href=\\\"https://spring.io/blog/2022/02/21/spring-security-5-5-5-and-5-6-2-released\\\">released</a> with bug fixes, minor improvements and dependency upgrades. Both versions introduce the <strong><code><a href=\\\"https://docs.spring.io/spring-security/site/docs/current-SNAPSHOT/api/org/springframework/security/web/access/AuthorizationManagerWebInvocationPrivilegeEvaluator.html\\\">AuthorizationManagerWebInvocationPrivilegeEvaluator</a></code></strong> class that serves as an implementation of the <strong><code><a href=\\\"https://docs.spring.io/spring-security/site/docs/current-SNAPSHOT/api/org/springframework/security/web/access/WebInvocationPrivilegeEvaluator.html\\\">WebInvocationPrivilegeEvaluator</a></code></strong> interface which delegates the checks to an instance of <strong><code>AuthorizationManager</code></strong>.</p>\\n<p>Spring Session versions 2021.1.2 and 2021.0.5 were <a href=\\\"https://spring.io/blog/2022/02/23/spring-session-2021-0-5-and-2021-1-2-released\\\">released</a> this past week featuring dependency upgrades of versions 2.6.2 and 2.5.5, respectively, of <a href=\\\"https://spring.io/projects/spring-session-core\\\">Spring Session Core</a>, <a href=\\\"https://spring.io/projects/spring-session-data-redis\\\">Spring Session Data Redis</a>, <a href=\\\"https://spring.io/projects/spring-session-jdbc\\\">Spring Session JDBC</a> and <a href=\\\"https://spring.io/projects/spring-session-hazelcast\\\">Spring Session Hazelcast</a> and <a href=\\\"https://spring.io/projects/spring-session-data-mongodb\\\">Spring Session MongoDB</a> (for Spring Session 2021.1.2 only).</p>\\n<p>On the road to Spring Shell 2.1.0, the <a href=\\\"https://spring.io/blog/2022/02/25/spring-shell-2-1-0-m3-is-now-available\\\">third milestone release</a> was made available to feature initial work on a higher level UI Component model to enhance building more attractive interactions with users. An example may be found in the <a href=\\\"https://github.com/spring-projects/spring-shell/releases/tag/v2.1.0-M3\\\">release notes</a>.</p>\\n<p>Spring Batch 4.3.5 was <a href=\\\"https://spring.io/blog/2022/02/23/spring-batch-4-3-5-available-now\\\">released</a> featuring bug fixes and dependency upgrades. Enhancements include: <a href=\\\"https://github.com/spring-projects/spring-batch/pull/3997\\\">simplify the GET_LAST_STEP_EXECUTION field</a> in the <strong><code><a href=\\\"https://docs.spring.io/spring-batch/docs/current/api/org/springframework/batch/core/repository/dao/JdbcStepExecutionDao.html\\\">JdbcStepExecutionDao</a></code></strong> class to use an equi-join instead of an cartesian join with a subselect; <a href=\\\"https://github.com/spring-projects/spring-batch/pull/4034\\\">add the @Nullable annotation</a> the <strong><code>getEndtime()</code></strong> method defined in the <strong><code><a href=\\\"https://docs.spring.io/spring-batch/docs/current/api/org/springframework/batch/core/StepExecution.html\\\">StepExecution</a></code></strong> class; and <a href=\\\"https://github.com/spring-projects/spring-batch/pull/4014\\\">implement argument checks</a> of the <strong><code>setSort()</code></strong> class defined in the <strong><code><a href=\\\"https://docs.spring.io/spring-batch/docs/current/api/org/springframework/batch/item/data/MongoItemReader.html\\\">MongoItemReader</a></code></strong> class. Further details may be found in the <a href=\\\"https://github.com/spring-projects/spring-batch/releases/tag/4.3.5\\\">changelog</a>.</p>\\n<h3>Quarkus</h3>\\n<p>Quarkus 2.7.2.Final, the <a href=\\\"https://quarkus.io/blog/quarkus-2-7-2-final-released/\\\">second maintenance release</a>, was made available featuring dependency upgrades of <a href=\\\"https://kogito.kie.org/\\\">Kogito</a> 1.17.0.Final and <a href=\\\"https://www.optaplanner.org/\\\">OptaPlanner</a> 8.17.0.Final. More details may be found in the <a href=\\\"https://github.com/quarkusio/quarkus/releases/tag/2.7.2.Final\\\">changelog</a>.</p>\\n<h3>JReleaser</h3>\\n<p>On the road to version 1.0.0, an updated <a href=\\\"https://github.com/jreleaser/jreleaser/releases/tag/early-access\\\">early-access</a> release of <a href=\\\"https://jreleaser.org/\\\">JReleaser</a> was made available this past week featuring adding Windows resources to the configuration of <strong><code>jpackage</code></strong>, a tool that may be used to assemble distributions of type <strong><code>NATIVE_PACKAGE</code></strong>.</p>\\n<div class=\\\"author-section-full\\\"><!-- main wrapper for authors section -->\\n<h2>About the Author</h2>\\n<!-- section title -->\\n<div class=\\\"author\\\" data-id=\\\"author-Michael-Redlich\\\"><!-- main wrapper for each author --> <a class=\\\"avatar author__avatar\\\" href=\\\"/profile/Michael-Redlich/\\\"><img src=\\\"https://cdn.infoq.com/statics_s2_20220224031711/images/profiles/TxhBF2gloUbm6EjmEsvlQPphHPLElD6g.jpg\\\" /></a>\\n<div class=\\\"content-author\\\">\\n<h4><strong>Michael Redlich</strong></h4>\\n<div class=\\\"show-author-bio\\\">\\n<p><!-- author bio will be inserted by frontend --> Michael Redlich is a Senior Research Technician at ExxonMobil Research &amp; Engineering in Clinton, New Jersey (views and opinions provided here are his own and not those of his employer). He is an IT Professional with a BS in Computer Science from Rutgers University. He has facilitated the Garden State Java User Group (formerly ACGNJ Java Users Group) since 2001, an experienced conference speaker, and co-authored several articles with Barry Burd before joining InfoQ. As a long-time employee of heritage Exxon and ExxonMobil since December 1989, Mike has enjoyed numerous assignments with the Company including automotive testing, analytical sciences practicing infrared spectroscopy and chemometrics, developing scientific IT applications, and, in his current assignment, polymer science practicing rheology and polymer physics. Throughout his career, Mike has developed leadership skills which he utilized having previously served as President of the Amateur Computer Group of New Jersey, a non-profit 501(c)(3) computer education organization, and currently as Director of the Garden State Java User Group, also a non-profit 501(c)(3) organization. Mike is a member of Toastmasters International and has recently achieved his Advanced Communicator Silver certificate. He is also an avid runner/cyclist having completed numerous marathons. Mike resides in Flemington, New Jersey with his wife, Rowena, where they spend quality time cycling/running and traveling primarily to New Orleans, LA and Newport, RI.</p>\\n</div>\\n</div>\\n</div>\\n</div>\\n</div>\", \"date_created\": \"2022-02-28T16:55:20.000Z\", \"date_updated\": \"2022-03-11T05:25:27.000Z\", \"user_created\": \"0dce201f-f8eb-43da-b527-0a05ed9aa9d9\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2022-04-12\"}','{\"tags\": [\"Java\", \"Jdk\", \"Programming\", \"Sdk\", \"Technical\"], \"date_updated\": \"2022-03-11T05:25:26.905Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1367,1562,'blog','2','{\"id\": 2, \"sort\": null, \"tags\": [\"Development\", \"Javascript\", \"Programming\", \"React\", \"Webdev\"], \"image\": \"aed2a478-506f-4669-8994-fc1960c5f971\", \"title\": \"What is React-Redux ?\", \"author\": \"Kuber Dhure\", \"status\": \"published\", \"content\": \"<h2>Predictable state container</h2>\\n<ul>\\n<li><strong>Redux</strong>&nbsp;is a predictable state container for&nbsp;<strong>JavaScript</strong>&nbsp;apps</li>\\n<li>Helps you write apps that behaves consistently, run in different environments, and are easy to test.</li>\\n<li>Offers live code editing combined with a time traveling debugger.</li>\\n<li>Can be use with&nbsp;<strong>React</strong>,&nbsp;<strong>angular</strong>&nbsp;, or any other view library.</li>\\n<li>Redux is tiny(roughly 2kb), but has a large ecosystem of addons available.</li>\\n</ul>\\n<h2><a href=\\\"https://dev.to/shubhamathawane/what-is-react-redux--4ldi#central-store\\\" name=\\\"central-store\\\"></a>Central store</h2>\\n<ul>\\n<li>With&nbsp;<strong>Redux</strong>, application state is kept in a store, from which any component can access any state it needs</li>\\n<li>State is kept in a single place, improving predictability and traceability</li>\\n<li>In&nbsp;<strong>React</strong>, for example, state has to live in the parent component to share data among siblings</li>\\n<li>And so, sharing state between components that are far away from each other is hard state will have to be lifted until a common ancestor is found</li>\\n<li><strong>Redux</strong>&nbsp;solves this issue by providing a central store holding the entire application state</li>\\n</ul>\\n<h2><a href=\\\"https://dev.to/shubhamathawane/what-is-react-redux--4ldi#features-of-redux\\\" name=\\\"features-of-redux\\\"></a>Features of Redux</h2>\\n<ul>\\n<li>Predictable - Redux helps you write apps that behave consistently</li>\\n<li>Centralized application state and logic enables powerful capabilities, such as undo/redo, state persistence, etc.</li>\\n<li>Debuggable - Redux DevTools make it easy to trace state, changes</li>\\n<li>Time-travel debugging is also possible</li>\\n<li>Flexible - Redux works with any UI layer</li>\\n</ul>\", \"date_created\": \"2022-03-01T08:56:34.000Z\", \"date_updated\": \"2022-03-11T05:26:05.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2023-03-15\"}','{\"tags\": [\"Development\", \"Javascript\", \"Programming\", \"React\", \"Webdev\"], \"date_updated\": \"2022-03-11T05:26:04.665Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1368,1563,'blog','2','{\"id\": 2, \"sort\": null, \"tags\": [\"Development\", \"Java_script\", \"Javascript\", \"Programming\", \"React\", \"React Native\", \"React_js\", \"Webdev\"], \"image\": \"aed2a478-506f-4669-8994-fc1960c5f971\", \"title\": \"What is React-Redux ?\", \"author\": \"Kuber Dhure\", \"status\": \"published\", \"content\": \"<h2>Predictable state container</h2>\\n<ul>\\n<li><strong>Redux</strong>&nbsp;is a predictable state container for&nbsp;<strong>JavaScript</strong>&nbsp;apps</li>\\n<li>Helps you write apps that behaves consistently, run in different environments, and are easy to test.</li>\\n<li>Offers live code editing combined with a time traveling debugger.</li>\\n<li>Can be use with&nbsp;<strong>React</strong>,&nbsp;<strong>angular</strong>&nbsp;, or any other view library.</li>\\n<li>Redux is tiny(roughly 2kb), but has a large ecosystem of addons available.</li>\\n</ul>\\n<h2><a href=\\\"https://dev.to/shubhamathawane/what-is-react-redux--4ldi#central-store\\\" name=\\\"central-store\\\"></a>Central store</h2>\\n<ul>\\n<li>With&nbsp;<strong>Redux</strong>, application state is kept in a store, from which any component can access any state it needs</li>\\n<li>State is kept in a single place, improving predictability and traceability</li>\\n<li>In&nbsp;<strong>React</strong>, for example, state has to live in the parent component to share data among siblings</li>\\n<li>And so, sharing state between components that are far away from each other is hard state will have to be lifted until a common ancestor is found</li>\\n<li><strong>Redux</strong>&nbsp;solves this issue by providing a central store holding the entire application state</li>\\n</ul>\\n<h2><a href=\\\"https://dev.to/shubhamathawane/what-is-react-redux--4ldi#features-of-redux\\\" name=\\\"features-of-redux\\\"></a>Features of Redux</h2>\\n<ul>\\n<li>Predictable - Redux helps you write apps that behave consistently</li>\\n<li>Centralized application state and logic enables powerful capabilities, such as undo/redo, state persistence, etc.</li>\\n<li>Debuggable - Redux DevTools make it easy to trace state, changes</li>\\n<li>Time-travel debugging is also possible</li>\\n<li>Flexible - Redux works with any UI layer</li>\\n</ul>\", \"date_created\": \"2022-03-01T08:56:34.000Z\", \"date_updated\": \"2022-03-11T05:27:30.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"date_published\": \"2023-03-15\"}','{\"tags\": [\"Development\", \"Java_script\", \"Javascript\", \"Programming\", \"React\", \"React Native\", \"React_js\", \"Webdev\"], \"date_updated\": \"2022-03-11T05:27:30.340Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1369,1565,'info_page_section','6','{\"id\": 6, \"sort\": null, \"title\": \"Map Location\", \"status\": \"published\", \"info_page\": 4, \"description\": \"<p><iframe style=\\\"border: 0;\\\" tabindex=\\\"0\\\" src=\\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3771.955560694125!2d72.8677590149003!3d19.0216797871191!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7cf48beff6adb%3A0x8b57459cf41f7a2c!2sVidyalankar%20Polytechnic!5e0!3m2!1sen!2sin!4v1587674082566!5m2!1sen!2sin&amp;key=AIzaSyDnIDpwWYYJe9piJEdiNF7vqtxcAlq3Otk\\\" width=\\\"100%\\\" height=\\\"450\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" aria-hidden=\\\"false\\\"></iframe></p>\", \"date_created\": \"2022-03-11T03:00:27.000Z\", \"date_updated\": \"2022-03-11T07:46:23.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}','{\"info_page\": \"4\", \"description\": \"<p><iframe style=\\\"border: 0;\\\" tabindex=\\\"0\\\" src=\\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3771.955560694125!2d72.8677590149003!3d19.0216797871191!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7cf48beff6adb%3A0x8b57459cf41f7a2c!2sVidyalankar%20Polytechnic!5e0!3m2!1sen!2sin!4v1587674082566!5m2!1sen!2sin&amp;key=AIzaSyDnIDpwWYYJe9piJEdiNF7vqtxcAlq3Otk\\\" width=\\\"100%\\\" height=\\\"450\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" aria-hidden=\\\"false\\\"></iframe></p>\", \"date_updated\": \"2022-03-11T07:46:23.335Z\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}',1370),(1370,1566,'info_page','4','{\"id\": 4, \"icon\": \"6618b1a9-7394-4939-8120-2beedc59b056\", \"name\": \"Locate Us\", \"sort\": null, \"status\": \"published\", \"sections\": [5, 6], \"date_created\": \"2022-03-11T02:58:50.000Z\", \"date_updated\": \"2022-03-11T07:46:23.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}','{\"date_updated\": \"2022-03-11T07:46:23.325Z\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}',NULL),(1371,1567,'info_page_section','6','{\"id\": 6, \"sort\": null, \"title\": \"Map Location\", \"status\": \"published\", \"info_page\": 4, \"description\": \"<p><iframe style=\\\"border: 0;\\\" tabindex=\\\"0\\\" src=\\\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3771.955560694125!2d72.8677590149003!3d19.0216797871191!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3be7cf48beff6adb%3A0x8b57459cf41f7a2c!2sVidyalankar%20Polytechnic!5e0!3m2!1sen!2sin!4v1587674082566!5m2!1sen!2sin&amp;key=AIzaSyDnIDpwWYYJe9piJEdiNF7vqtxcAlq3Otk\\\" width=\\\"100%\\\" height=\\\"450\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" aria-hidden=\\\"false\\\"></iframe></p>\", \"date_created\": \"2022-03-11T03:00:27.000Z\", \"date_updated\": \"2022-03-11T07:47:23.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"973782b7-e96e-415b-b382-e7820a2fa7ff\"}','{\"info_page\": \"4\", \"date_updated\": \"2022-03-11T07:47:23.243Z\", \"user_updated\": \"973782b7-e96