ulty\", \"group\": null, \"collection\": \"department\"}',NULL),(1515,1727,'directus_fields','311','{\"id\": 311, \"note\": null, \"sort\": 15, \"field\": \"courses\", \"group\": null, \"width\": \"full\", \"hidden\": false, \"display\": null, \"options\": {\"template\": \"{{course_id.name}} ({{semester_id.title}})\"}, \"special\": [\"o2m\"], \"readonly\": false, \"required\": true, \"interface\": \"list-o2m\", \"collection\": \"department\", \"conditions\": null, \"translations\": null, \"display_options\": null}','{\"sort\": 15, \"field\": \"courses\", \"group\": null, \"collection\": \"department\"}',NULL),(1516,1728,'department','1','{\"id\": 1, \"abbr\": \"CO\", \"icon\": null, \"name\": \"Computer Engineering\", \"sort\": null, \"status\": \"published\", \"vision\": \"<p>To empower students with domain knowledge of Computer Engineering and interpersonal skills to cater to the industrial and societal needs.</p>\", \"courses\": [], \"faculty\": [3], \"mission\": \"<p>M1: Developing technical skills by explaining the rationale behind learning.</p>\\n<p>&nbsp;</p>\\n<p>M2: Developing interpersonal skills to serve the society in the best possible manner.</p>\\n<p>&nbsp;</p>\\n<p>M3: Creating awareness about the ever changing professional practices to build industrial adaptability</p>\", \"outcomes\": \"<p>Basic and Discipline specific knowledge: Apply knowledge of basic mathematics, science and engineering fundamentals and engineering specialization to solve the engineering problems.</p>\\n<p>&nbsp;</p>\\n<p>Problem analysis: Identify and analyse well-defined engineering problems using codified standard methods.</p>\\n<p>&nbsp;</p>\\n<p>Design/ development of solutions: Design solutions for well-defined technical problems and assist with the design of systems components or processes to meet specified needs.</p>\\n<p>&nbsp;</p>\\n<p>Engineering Tools, Experimentation and Testing: Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n<p>&nbsp;</p>\\n<p>Engineering practices for society, sustainability and environment: Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p>&nbsp;</p>\\n<p>Project Management: Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p>&nbsp;</p>\\n<p>Life-long learning Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\", \"date_created\": \"2022-02-26T14:39:50.000Z\", \"date_updated\": \"2022-03-11T18:57:09.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"abbr\": \"CO\", \"date_updated\": \"2022-03-11T18:57:08.801Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1517,1729,'department','2','{\"id\": 2, \"abbr\": \"IF\", \"icon\": null, \"name\": \"Information Technology\", \"sort\": null, \"status\": \"published\", \"vision\": \"<p>To become a leading center in the domain of Information Technology where learners are introduced to the concepts and implementation of technologies.</p>\", \"courses\": [1], \"faculty\": [1], \"mission\": \"<p class=\\\"text-justify\\\">M1:Encouraging academic excellence and a passion for learning through the use of learner-oriented teaching methodologies.</p>\\n<p class=\\\"text-justify\\\">M2:Providing an environment that inculcates ethics and effective soft-skills and focuses on the development of learners.</p>\\n<p class=\\\"text-justify\\\">M3:Establishing and reinforcing a symbiotic institute-industry interface so that learners can gain exposure to real-life applications of Information Technology.</p>\", \"outcomes\": \"<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Basic and Discipline specific knowledge:</strong>&nbsp;Apply knowledge of basic mathematics, science and engineering fundamentals and engineering specialization to solve the engineering problems.</p>\\n<p class=\\\"text-justify\\\"><strong>Problem analysis:&nbsp;</strong>Identify and analyse well-defined engineering problems using codified standard methods.</p>\\n<p class=\\\"text-justify\\\"><strong>Design/ development of solutions:</strong>&nbsp;Design solutions for well-defined technical problems and assist with the design of systems components or processes to meet specified needs.</p>\\n<p class=\\\"text-justify\\\"><strong>Engineering Tools, Experimentation and Testing:</strong>&nbsp;Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n</div>\\n<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Engineering practices for society, sustainability and environment:</strong>&nbsp;Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p class=\\\"text-justify\\\"><strong>Project Management:</strong>&nbsp;Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p class=\\\"text-justify\\\"><strong>Life-long learning:</strong>&nbsp;Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\\n</div>\", \"date_created\": \"2022-02-28T13:12:08.000Z\", \"date_updated\": \"2022-03-11T18:57:16.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"abbr\": \"IF\", \"date_updated\": \"2022-03-11T18:57:16.467Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1518,1730,'department','3','{\"id\": 3, \"abbr\": \"EJ\", \"icon\": null, \"name\": \"Electronics and Telecommunication\", \"sort\": null, \"status\": \"published\", \"vision\": \"<p>To produce Electronics and Telecommunication engineers capable of effectively using technical knowledge and interpersonal skills to benefit the industry and society.</p>\", \"courses\": [2], \"faculty\": [2], \"mission\": \"<p class=\\\"text-justify\\\">M1:Providing state of the art facilities and conducive environment enabling the students to sustain the challenges in the field of Electronics and Telecommunication.</p>\\n<p class=\\\"text-justify\\\">M2:Educating the students to face the competitive world, develop leadership skills and to instil discipline and ethics.</p>\\n<p class=\\\"text-justify\\\">M3:Promoting industry institute interaction.</p>\", \"outcomes\": \"<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Basic and Discipline specific knowledge:&nbsp;</strong>Apply knowledge of basic mathematics, science and engineering fundamentals and engineering specialization to solve the engineering problems.</p>\\n<p class=\\\"text-justify\\\"><strong>Problem analysis:&nbsp;</strong>Identify and analyse well-defined engineering problems using codified standard methods.</p>\\n<p class=\\\"text-justify\\\"><strong>Design/ development of solutions:&nbsp;</strong>Design solutions for well-defined technical problems and assist with the design of systems components or processes to meet specified needs.</p>\\n<p class=\\\"text-justify\\\"><strong>Engineering Tools, Experimentation and Testing:&nbsp;</strong>Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n</div>\\n<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Engineering practices for society, sustainability and environment:&nbsp;</strong>Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p class=\\\"text-justify\\\"><strong>Project Management:&nbsp;</strong>Use engineering management principles individually, as a team member or a leader to manage projects and effectivel