ols, Experimentation and Testing:&nbsp;</strong>Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n</div>\\n<div class=\\\"col-md-6 text-left\\\">\\n<p class=\\\"text-justify\\\"><strong>Engineering practices for society, sustainability and environment:&nbsp;</strong>Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p class=\\\"text-justify\\\"><strong>Project Management:&nbsp;</strong>Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p class=\\\"text-justify\\\"><strong>Life-long learning:&nbsp;</strong>Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\\n</div>\", \"date_created\": \"2022-02-28T14:10:38.000Z\", \"date_updated\": \"2022-03-11T18:58:23.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"icon\": \"bf3f1535-1d2d-4a4d-851a-949e913df76a\", \"date_updated\": \"2022-03-11T18:58:23.023Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1523,1735,'directus_permissions','66','{\"id\": 66, \"role\": null, \"action\": \"read\", \"fields\": [\"id\", \"sort\", \"name\", \"vision\", \"mission\", \"outcomes\", \"faculty\", \"courses\", \"abbr\", \"icon\"], \"presets\": null, \"collection\": \"department\", \"validation\": null, \"permissions\": {\"_and\": [{\"status\": {\"_contains\": \"published\"}}]}}','{\"role\": null, \"action\": \"read\", \"fields\": [\"id\", \"sort\", \"name\", \"vision\", \"mission\", \"outcomes\", \"faculty\", \"courses\", \"abbr\", \"icon\"], \"presets\": null, \"collection\": \"department\", \"validation\": null, \"permissions\": {\"_and\": [{\"status\": {\"_contains\": \"published\"}}]}}',NULL),(1524,1736,'directus_files','4949e1ba-887f-4dbe-8aa