:47:22.000Z\", \"date_updated\": \"2022-03-12T00:02:55.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"date_updated\": \"2022-03-12T00:02:55.396Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1545,1758,'info_page_section','9','{\"id\": 9, \"sort\": null, \"title\": \"Core Values\", \"status\": \"published\", \"info_page\": 5, \"description\": \"<p><strong>Vidyalankar believes that character building is an important step towards nation-building. Nurturing young minds is a vital responsibility. Vidyalankar Values are the set of ideals which guide the attitudes and behaviour of the members of the Vidyalankar family. It is said that there are no short-cuts on the road to success. Educating students on ethics, to differentiate between right and wrong and motivating them to choose the right path is imperative. The following values are interspersed in all aspects of the teaching-learning process.</strong></p>\\n<ul>\\n<li>Honesty</li>\\n<li>Integrity</li>\\n<li><strong>Excellence</strong></li>\\n<li><strong>Responsibility</strong></li>\\n<li><strong>Commitment</strong></li>\\n<li><strong>Salubrious Attitude</strong></li>\\n</ul>\", \"date_created\": \"2022-03-11T17:29:22.000Z\", \"date_updated\": \"2022-03-12T00:08:42.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"info_page\": \"5\", \"description\": \"<p><strong>Vidyalankar believes that character building is an important step towards nation-building. Nurturing young minds is a vital responsibility. Vidyalankar Values are the set of ideals which guide the attitudes and behaviour of the members of the Vidyalankar family. It is said that there are no short-cuts on the road to success. Educating students on ethics, to differentiate between right and wrong and motivating them to choose the right path is imperative. The following values are interspersed in all aspects of the teaching-learning process.</strong></p>\\n<ul>\\n<li>Honesty</li>\\n<li>Integrity</li>\\n<li><strong>Excellence</strong></li>\\n<li><strong>Responsibility</strong></li>\\n<li><strong>Commitment</strong></li>\\n<li><strong>Salubrious Attitude</strong></li>\\n</ul>\", \"date_updated\": \"2022-03-12T00:08:41.875Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',1546),(1546,1759,'info_page','5','{\"id\": 5, \"icon\": \"d1a2c059-cffc-4deb-9016-0b684f6bebb0\", \"name\": \"About Us\", \"sort\": 4, \"status\": \"published\", \"sections\": [9, 10, 11], \"date_created\": \"2022-03-11T17:15:02.000Z\", \"date_updated\": \"2022-03-12T00:08:42.000Z\", \"user_created\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}','{\"date_updated\": \"2022-03-12T00:08:41.867Z\", \"user_updated\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\"}',NULL),(1547,1760,'directus_files','b9c4949c-39a8-45db-8553-07143188a087','{\"type\": \"image/jpeg\", \"title\": \"Psx 20220312 082243\", \"folder\": \"b0fad43b-f7de-49bc-9388-68b512889a93\", \"storage\": \"local\", \"filename_download\": \"PSX_20220312_082243.jpg\"}','{\"type\": \"image/jpeg\", \"title\": \"Psx 20220312 082243\", \"folder\": \"b0fad43b-f7de-49bc-9388-68b512889a93\", \"storage\": \"local\", \"filename_download\": \"PSX_20220312_082243.jpg\"}',NULL),(1548,1761,'department','1','{\"id\": 1, \"abbr\": \"CO\", \"icon\": \"b9c4949c-39a8-45db-8553-07143188a087\", \"name\": \"Computer Engineering\", \"sort\": null, \"status\": \"published\", \"vision\": \"<p>To empower students with domain knowledge of Computer Engineering and interpersonal skills to cater to the industrial and societal needs.</p>\", \"courses\": [], \"faculty\": [3], \"mission\": \"<p>M1: Developing technical skills by explaining the rationale behind learning.</p>\\n<p>&nbsp;</p>\\n<p>M2: Developing interpersonal skills to serve the society in the best possible manner.</p>