/ development of solutions: Design solutions for well-defined technical problems and assist with the design of systems components or processes to meet specified needs.</p>\\n<p>&nbsp;</p>\\n<p>Engineering Tools, Experimentation and Testing: Apply modern engineering tools and appropriate technique to conduct standard tests and measurements.</p>\\n<p>&nbsp;</p>\\n<p>Engineering practices for society, sustainability and environment: Apply appropriate technology in context of society, sustainability, environment and ethical practices.</p>\\n<p>&nbsp;</p>\\n<p>Project Management: Use engineering management principles individually, as a team member or a leader to manage projects and effectively communicate about well-defined engineering activities.</p>\\n<p>&nbsp;</p>\\n<p>Life-long learning Ability to analyse individual needs and engage in updating in the context of technological changes.</p>\", \"date_created\": \"2022-02-26T14:39:50.000Z\", \"date_updated\": \"2022-03-12T05:46:53.000Z\", \"user_created\": \"bf90bfea-32c6-4cab-99c8-b633d48353a4\", \"user_updated\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\"}','{\"icon\": \"801c607b-b653-4353-a204-ebf6a4b5283a\", \"date_updated\": \"2022-03-12T05:46:52.848Z\", \"user_updated\": \"443b38a5-8dbf-4daa-8da5-89e53c05c695\"}',NULL),(1571,1789,'directus_files','b39c43a4-2065-4669-bee5-54f902add4ba','{\"type\": \"image/png\", \"title\": \"Icons8 It 64\", \"folder\": \"b0fad43b-f7de-49bc-9388-68b512889a93\", \"storage\": \"local\", \"filename_download\": \"icons8-it-64.png\"}','{\"type\": \"image/png\", \"title\": \"Icons8 It 64\", \"folder\": \"b0fad43b-f7de-49bc-9388-68b512889a93\", \"storage\": \"local\", \"filename_download\": \"icons8-it-64.png\"}',NULL),(1572,1790,'department','2','{\"id\": 2, \"abbr\": \"IF\", \"icon\": \"b39c43a4-2065-4669-bee5-54f902add4ba\", \"name\": \"Information Technology\", \"sort\": null, \"status\": \"published\", \"vision\": \"<p>To become a leading center in the domain of Information Technology w