INSERT INTO `info_page_section` VALUES (3,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-02 03:09:18','443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-06 12:40:01','Why Diploma','<p>Why Diploma after 10th for Engineering aspirants?</p>\n<ol>\n<li>Diploma pass students get direct second year admission, so number of years required to pass engineering remains same (2+4 and 3+3)</li>\n<li>NO entrance examination like JEE / CET for diploma students while getting degree admission</li>\n<li>Diploma curriculum offers more hands on practices so Industry prefer Diploma + Degree graduates while recruitment</li>\n<li>Diploma is only career path that provide job as well as entrepreneurship opportunity</li>\n<li>Diploma graduated can also opt for foreign university graduation courses</li>\n</ol>',3),(4,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-02 03:09:18','443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-06 12:40:01','Eligibilty','<p><strong>Eligibility for Admission to Diploma</strong></p>\n<p>Eligibility for First Year admission</p>\n<ul>\n<li>Indian Nationality</li>\n<li>S.S.C. or its Equivalent</li>\n<li>Students who have completed XII can also apply</li>\n</ul>\n<p>&nbsp;</p>\n<p>Eligibility for Second Year admission</p>\n<ul>\n<li>Passed 10 +2 examination with Physics and Chemistry as compulsory subjects along with Mathematics / Biology subject</li>\n<li>MCVC / ITI Pass (2 years) can be admitted to the respective branches</li>\n</ul>',3),(5,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-11 02:58:50',NULL,NULL,'Address','<p>Vidyalankar Marg, Sangam Nagar, Wadala East, Mumbai - 400037</p>',4),(6,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-11 03:00:27','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-11 18:18:03','Map Location','<p><a title=\"\" href=\"https://www.google.com/maps/place//data=!4m2!3m1!1s0x3be7cf48beff6adb:0x8b57459cf41f7a2c!11m1!4b1?entry=s&amp;sa=X\" target=\"_blank\" rel=\"noopener\">Locate Us</a></p>',4),(7,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:04:05','443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:05:22','Rules for FY admissions','<p><img src=\"https://aws.cms.vp.appsinfra.in/assets/9f079c1a-7697-4810-ae27-4f3bd74df5a3?width=1047&amp;height=485\" alt=\"Admission Rules FY\" /></p>',3),(8,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:15:02','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-11 23:57:37','Vision','<h2>Vision:</h2>\n<p>To achieve excellence in imparting technical education so as to meet the professional and societal needs.</p>',8),(9,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:29:22','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-12 00:08:42','Core Values','<p><strong>Vidyalankar believes that character building is an important step towards nation-building. Nurturing young minds is a vital responsibility. Vidyalankar Values are the set of ideals which guide the attitudes and behaviour of the members of the Vidyalankar family. It is said that there are no short-cuts on the road to success. Educating students on ethics, to differentiate between right and wrong and motivating them to choose the right path is imperative. The following values are interspersed in all aspects of the teaching-learning process.</strong></p>\n<ul>\n<li>Honesty</li>\n<li>Integrity</li>\n<li><strong>Excellence</strong></li>\n<li><strong>Responsibility</strong></li>\n<li><strong>Commitment</strong></li>\n<li><strong>Salubrious Attitude</strong></li>\n</ul>',5),(10,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:29:22',NULL,NULL,'Accreditation','<p>Department of Computer Engineering, Department of Electronics and Telecommunication Engineering and Department of Information Technology are accredited by&nbsp;<strong>National Board of Accreditation (NBA)</strong>.</p>\n<p><img src=\"https://aws.cms.vp.appsinfra.in/assets/7590e2c4-fc6e-4a32-948a-5520c0b53fdd?width=253&amp;height=199\" alt=\"Nba\" /></p>\n<p><a title=\"\" href=\"https://vpt.edu.in/diploma/polytechnic/images/about/nba_letter.pdf\" target=\"_blank\" rel=\"noopener\">View NBA extension letter</a></p>',5),(11,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:37:46',NULL,NULL,'Statutory committees','<ul>\n<li>Anti-ragging commitee</li>\n<li>Governing Body</li>\n<li>Women Grievance redressal / Internal complaint committee</li>\n<li>Staff grievance redress comittee</li>\n<li>Scheduled caste / Scheduled tribe committee</li>\n</ul>',5),(12,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:47:22','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-12 00:02:55','Address','<p><a title=\"\" href=\"https://g.page/Best-Diploma-College-in-Mumbai?share\" target=\"_blank\" rel=\"noopener\">Vidyalankar College Marg, Wadala (East), Mumbai - 400037</a></p>',NULL),(13,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:47:22','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-12 00:02:47','Contact Number','<p><a href=\"tel:+91 22 2416 11 26\">+91 22 2416 11 26</a></p>\n<p><strong>(COVID-19 Restricted Timings)<br />Please Write to Us</strong></p>',6),(14,'published',NULL,'443b38a5-8dbf-4daa-8da5-89e53c05c695','2022-03-11 17:47:22',NULL,NULL,'Write to us','<p><a title=\"\" href=\"https://vpt.edu.in/diploma/polytechnic/write_us.html\" target=\"_blank\" rel=\"noopener\">Click here</a></p>',6),(15,'published',NULL,'bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-11 23:54:51','bf90bfea-32c6-4cab-99c8-b633d48353a4','2022-03-12 00:01:34','Mission','<h2>Mission:</h2>\n<p>Developing technical skills by imparting knowledge and providing hands on experience.</p>\n<p>Creating an environment that nurtures ethics, leadership and team building.</p>\n<p>Providing industrial exposure for minimizing the gap between academics &amp; industry.</p>',8);
